NOW SUBWAY SIMULATOR LETS YOU:
- upgrade your driver and make an illustrious career;
- choose from 4 subway trains and customize them;
- discover 4 intricate routes;
- switch between the views: from cab view to car view.

SUBWAY CAREER
You can upgrade your driver. Collect authority points and get a promotion to unlock more routes and trains. Reach the highest rank to unlock all of them. Points are given to you for each completed route, but also for the total number of passengers you delivered.

HOW TO OPERATE
- Choose a route and a train: you can drive up to 3 cars;
- Make doors open/close using the “door” button;
- Use the lever to speed up/slow down;
- Track the number of passengers: deliver as many as you can;
- Change the camera view to see how many passengers there are in a car;
- Track your speed or get fined – follow the speed limit instructions;
- Use the warning signal when necessary.

Enjoy the renovated, reinvented Subway Simulator 3D with its new trains, routes and possibilities!

If you need to check your sound, take a look at this useful tool! Sound Check app is designed to generate sound with various frequency, from very low to very high. With this helpful utility you can easily check the sound quality of your headphones or just make some noise!

The main features of Sound Check app:
- a wide range of available wave frequency;
- 4 types of waves to choose from: sine, saw-tooth, triangle, and plane;
- a handy generator of different sounds and noises.

This app can be a checking tool for any headphones you're about to buy but want to test the quality of sound right off the bat, or a cool app for everyone who loves to tinker with sounds, sound waves, and sound effects!

